tables.table_schema:
CREATE TABLE bioengineered_foods (
    id INT PRIMARY KEY,
    food_name TEXT,
    consumer_feedback TEXT
);

CREATE TABLE product_development_strategies (
    id INT PRIMARY KEY,
    strategy_name TEXT,
    effectiveness_rating INT
);

CREATE TABLE consumer_feedback (
    feedback_id INT PRIMARY KEY,
    feedback_text TEXT,
    rating INT,
    food_item_id INT
);

CREATE TABLE food_items (
    food_item_id INT PRIMARY KEY,
    food_name TEXT,
    ingredient TEXT,
    category TEXT
);

CREATE TABLE product_development (
    dev_id INT PRIMARY KEY,
    food_item_id INT,
    developer_name TEXT,
    development_status TEXT
);

CREATE TABLE ConsumerFeedback (
  feedback_id INT PRIMARY KEY,
  feedback_text TEXT,
  rating INT,
  product_id INT
);

CREATE TABLE BioengineeredProducts (
  product_id INT PRIMARY KEY,
  product_name VARCHAR(50),
  ingredients TEXT,
  manufacturer VARCHAR(50)
);

CREATE TABLE ProductRatings (
  rating_id INT PRIMARY KEY,
  product_id INT,
  rating_value INT,
  feedback_id INT
);

CREATE TABLE ProductAnalysis (
  analysis_id INT PRIMARY KEY,
  product_id INT,
  feedback_id INT,
  insight TEXT
);
